    @Test
    public void testApplies() throws Exception {

        Integer.valueOf(VSOProperties.getBasePort() + 90).toString();


        boolean applies = new JSONExtractor().applies("{");
        assertTrue(applies);

        boolean notApplies = new JSONExtractor().applies("aaa{bbb");
        assertFalse(notApplies);

    }

