    @Test
    public void testExtractSingleItemArray() throws Exception {
        String data = "{\t\"cct\": 1,\t\"ddu\": [1],\t\"qty\": [\t\t[1]\t]}";
        List<Pair> extract = new JSONExtractor().extract(data);
        assertEquals(3, extract.size());
        System.out.println(extract);
    }


    @Test
    public void testExtractSimpleJson() throws Exception {
        String data = "{\n" +
                "\t\"age\" : 24,\n" +
                "\t\"weight\" : 90.5,\n" +
                "\t\"hometown\" : \"Missoula, MT\",\n" +
                "\t\"gender\" : \"male\"\n" +
                "}";
        List<Pair> extract = new JSONExtractor().extract(data);
        assertEquals(4, extract.size());
        System.out.println(extract);
    }
    @Test
    public void testExtractArray() throws Exception {
        String data = "[{\n" +
                "    \"name\" : \"Jason\",\n" +
                "    \"age\" : \"24\",\n" +
                "    \"gender\" : \"male\"\n" +
                "},\n" +
                "{\n" +
                "    \"name\" : \"Kyle\",\n" +
                "    \"age\" : \"21\",\n" +
                "    \"gender\" : \"male\"\n" +
                "}]";
        List<Pair> extract = new JSONExtractor().extract(data);
        assertEquals(6, extract.size());
        System.out.println(extract.toString());
    }



